import {useEffect} from 'react';
import axios from 'axios';
import TextField from '@material-ui/core/TextField';
import SearchIcon from '@material-ui/icons/Search';
import { makeStyles } from '@material-ui/core/styles';

function iconStyles() {
    return {
        searchIconColor: {
            color: 'grey',
            margin: 'auto'
        }
    }
}

export default function Search(props) {
    const classes = makeStyles(iconStyles)();
    const {setDisplayNavbar, setUser} = props;
    setDisplayNavbar(true);
    useEffect(() => {
        const ac = new AbortController();

        axios.get('/auth/isLoggedIn')
            .then(res => res.data)
            .catch(err => console.log(err))
            .then(res => {
                if (res.isLoggedIn) {
                    const user = res.user;
                    console.log(user);
                    setUser(user);
                } else {
                    window.open('/', '_self');
                }
            })

        return () => {
            ac.abort();
        }
    }, [setUser]);
    return <div className="wrapper">
        <div className="content" style={{flex: "1"}}>
            <div className="box">
                <div className="box_top" style={{textAlign: "center"}}>
                    <div className="navbar_input" style={{margin: "auto", width: "70%"}}>
                        <SearchIcon className={classes.searchIconColor}/>
                        <input placeholder="Search subjects or tutors" autoComplete="off" type="text"/>
                    </div>
                </div>
            </div>
        </div>
    </div>
}
